import React from 'react';
const FooterButtons = (props) => {
  const { submitLabel } = props;
  return (
    <div className="right">
      <button className="form-control" type="submit" className="btn btn-primary">{submitLabel || 'Submit'}</button>
    </div>
  );
};

export default FooterButtons;
